import React ,{useState,useEffect} from 'react';
import User from "./User";
import Palette from "./Palette";
import Yuti from "./yuti";

const Profile = () => {
    
    var state = {
        name:"keanu",
        surname:"reevessss",
        src:"https://i2.wp.com/www.intelligentliving.co/wp-content/uploads/2019/09/Keanu-Reeves-1.jpg?fit=2100%2C1200&ssl=1",
        alt:"man"    
    }
    
    const{name,surname,src,alt} = state ;
    var[show,sethow] = useState(false);
    var[hop,sethop] = useState(false)
    // setName="banana" ;
    // useEffect (() =>{
    //     gaxsna();
    //     alert("me")
    //     return ( alert("shen") 
        
    //     )
    // },[]
    //)
    const open = ()=>{
        sethow(false);
        sethop(true);
    }

    const close = ()=>{
        sethow(true);
        sethop(false);
    }
    
return(
    <div className="container profile">
        
        {/* {gachena?"close":"open"}  */}
        {show?<button onClick={open} >daxurva</button>
            :<button onClick={close}>gaxsna</button>}
        
        
    
        <User src={src}
            alt={alt} 
            surname={surname}
            />
            
            {gachena?<Yuti/>:""}
            
        

        <Palette/>
        
    </div>
    )
}

export default Profile ;
